      if (value[0] === '0') {
        value = value.substr(1, value.length);
      }

      var result = '';
      var check = true;

      while (check) {
        if (value.length > 3) {
          result = ', ' + value.substr(value.length - 3, 3) + result;
          value = value.substr(0, value.length - 3);
        } else {
          result = value + result;
          check = false;
        }
      }

      if (with_sign) {
        if (result.length) {
          result += ' ₽';
        } else {
          result = '0 ₽';
        }
      }

      if (minus) {
        result = '- ' + result;
      }

      return result;
